	public $suburbSpecial = ['McAlinden', 'McArthur', 'McBean Pound', 'McBeath', 'McCallum', 'McCracken', 'McCrae', 'McCullys Gap', 'McCutcheon', 'McDesme', 'McDougalls Hill', 'McDowall', 'McEwens Beach', 'McGraths Hill', 'McHarg Creek', 'McIlwraith', 'McIntosh Creek', 'McIntyre', 'McKail', 'McKees Hill', 'McKellar', 'McKellars Park', 'McKenzie Creek', 'McKenzie Hill', 'McKinlay', 'McKinnon', 'McLaren Flat', 'McLaren Vale', 'McLeans Ridges', 'McLeods Shoot', 'McLoughlins Beach', 'McMahons Creek', 'McMahons Point', 'McMahons Reef', 'McMillans', 'McMinns Lagoon'];

	/**
	 * Parse street number
	 *
	 * @param string $address Address
	 *
	 * @return array
	 */
	public function parse(string $address = ''): array
	{
		if (empty($address))
		{
			return [];
		}

		// prepare address
		$address = ucwords(strtolower(str_replace(',', ' ', $address)));

		// handle special suburbs
		$small   = array_map('ucwords', array_map('strtolower', $this->suburbSpecial));
		$address = str_replace($small, $this->suburbSpecial, $address);

		$address = $this->parseState($address);
		$address = $this->parseSuburb($address);
		$address = $this->parsePostcode($address);
		$address = $this->parseStreetType($address);
		$this->parseStreetNumber($address);

		$this->guessState();

		return $this->data;
	}

	/**
	 * Parse state
	 *
	 * @param string $address Address
	 *
	 * @return string
	 */
	protected function parseState(string $address): string
	{
		$states = array_merge(array_keys($this->states), array_values($this->states));
		
		for ($i = 0; $i < count($states); $i++)
		{

			if (strpos($address, $states[$i]) !== false)
			{
				if (strpos($address, $states[$i]) + strlen($states[$i]) + 5 < strlen($address))
				{
					continue;
				}

				$long = null;
				if (strlen($states[$i]) > 3)
				{
					$long  = $states[$i];
					$states[$i] = $this->states[$states[$i]];
				}

				$this->data['state'] = strtoupper($states[$i]);

				return $this->replaceLast($long !== null ? $long : $states[$i], '', $address);
			}
		}

		return $address;
	}

	/**
	 * Parse suburb
	 *
	 * @param string $address Address
	 *
	 * @return string
	 */
	protected function parseSuburb(string $address): string
	{
		if ( ! empty($this->data['state']))
		{
			$suburbs = $this->suburbs[$this->data['state']];
		}
		else
		{
			$suburbs = array_merge($this->suburbs['QLD'], $this->suburbs['NSW'], $this->suburbs['NT'], $this->suburbs['SA'], $this->suburbs['TAS'], $this->suburbs['VIC'], $this->suburbs['WA'], $this->suburb['ACT']);
		}

		for ($i = 0; $i < count($suburbs); $i++)
		{

			if (strpos($address, $suburbs[$i]) !== false)
			{
				if (strpos($address, $suburbs[$i]) + strlen($suburbs[$i]) + 4 < strlen($address) / 2)
				{
					continue;
				}

				$this->data['suburb'] = $suburbs[$i];

				return $this->replaceLast($suburbs[$i], '', $address);
			}
		}

		return $address;
	}

	/**
	 * Parse postcode number
	 *
	 * @param string $address Address
	 *
	 * @return string
	 */
	protected function parsePostcode(string $address): string
	{
		if ( ! empty($this->data['state']) && ! empty($this->data['suburb']))
		{
			$postcode = $this->postcodes[$this->data['state']][$this->data['suburb']] ?? '';

			$this->data['postcode'] = $postcode;
			return $this->replaceLast($postcode, '', $address);
		}
		elseif ( ! empty($this->data['state']))
		{
			$postcodes = array_values($this->postcodes[$this->data['state']]);

			for ($i = 0; $i < count($postcodes); $i++)
			{
				if (strpos($address, $postcodes[$i]) !== false)
				{
					$this->data['postcode'] = $postcodes[$i];

					return $this->replaceLast($postcodes[$i], '', $address);
				}
			}
		}

		$postcodes = array_merge(array_values($this->postcodes['QLD']), array_values($this->postcodes['NSW']), array_values($this->postcodes['NT']), array_values($this->postcodes['SA']), array_values($this->postcodes['TAS']), array_values($this->postcodes['VIC']), array_values($this->postcodes['WA']), array_values($this->postcodes['ACT']));
		

		for ($i = 0; $i < count($postcodes); $i++)
		{
			if (strpos($address, $postcodes[$i]) !== false)
			{
				$this->data['postcode'] = $postcodes[$i];

				return $this->replaceLast($postcodes[$i], '', $address);
			}
		}

		return $address;
	}

	/**
	 * Parse street type
	 *
	 * @param string $address Address
	 *
	 * @return string
	 */
	protected function parseStreetType(string $address): string
	{
		$types = array_merge(array_values($this->streets), array_keys($this->streets));

		for ($i = 0; $i < count($types); $i++)
		{
			if (strpos($address, $types[$i]) !== false)
			{
				$changed = null;
				if (strlen(trim($types[$i])) < 4)
				{
					$changed  = $types[$i];
					$array    = array_flip($this->streets);

					$changed  = ucfirst($changed);
					$changed  = $array[$changed];
					$array    = null;
				}

				$this->data['streetType'] = $changed === null ? trim($types[$i]) : trim($changed);

				return $this->replaceLast($types[$i], '', $address);
			}
		}

		return $address;
	}

	/**
	 * Parse street number
	 *
	 * @param string $address Address
	 *
	 * @return string
	 */
	protected function parseStreetNumber(string $address): string
	{
		preg_match_all('!\d+!', $address, $matches);

		if (empty($matches) || empty($matches[0]))
		{
			return $address;
		}

		if (count($matches[0]) === 1)
		{
			$this->data['streetNumber'] = $matches[0][0];
		}
		elseif (count($matches[0]) > 1)
		{
			$this->data['unitNumber']   = array_shift($matches[0]);
			$this->data['streetNumber'] = implode('-', $matches[0]);
		}

		$last = end($matches[0]);

		$address = substr($address, strpos($address, $last) + strlen($last));
		$address = preg_replace('/\s+/', ' ', $address);
		$address = trim($address);

		// support for letter in street number
		if (isset($address[1]) && $address[1] === ' ')
		{
			$this->data['streetNumber'] .= $address[0];
			$address = trim(substr($address, 2));
		}

		$this->data['streetName'] = $address;

		return $address;
	}

	/**
	 * Guess state if needed
	 *
	 * @return void
	 */
	protected function guessState(): void
	{
		if (empty($this->data['state']) && ! empty($this->data['suburb']))
		{
			foreach ($this->suburbs as $key => $sub)
			{
				if (in_array($this->data['suburb'], $sub))
				{
					$this->data['state'] = $key;
					break;
				}
			}
		}
	}

	/**
	 * replace last occurence
	 *
	 * @param string $search  Search
	 * @param string $replace Replace
	 * @param string $subject Subject
	 *
	 * @return string
	 */
	protected function replaceLast(string $search, string $replace, string $subject): string
	{
		$pos = strrpos($subject, $search);

		if ($pos !== false)
		{
			$subject = substr_replace($subject, $replace, $pos, strlen($search));
		}

		return $subject;
	}

